import { SetWalletMoneyContext, WalletMoneyContext } from 'App';
import { useContext } from 'react';
import { CoinBoxContainer, Count, Money } from './Coins.styled';
import CoinBox from './Coins/CoinBox';

export default function Coins() {
  const walletMoney = useContext(WalletMoneyContext);
  const setWalletMoney = useContext(SetWalletMoneyContext);

  const coinBoxs =
    walletMoney &&
    Object.entries(walletMoney.amount).map((wallet) => {
      createCoinBox(wallet);
    });

  return <CoinBoxContainer>{coinBoxs}</CoinBoxContainer>;
}

const createCoinBox = ([coin, cnt]) => {
  <CoinBox>
    <Money>{coin}</Money>
    <Count>{cnt}</Count>
  </CoinBox>;
};
